import React, { useState, useEffect } from 'react';
import './App.css';



function LogTable() {
  const [logData, setLogData] =  useState((JSON.parse(localStorage.getItem('logData'))) || []);
  const [input1, setInput1] = useState('');
  const [input2, setInput2] = useState('');
  const [input3, setInput3] = useState('');
  const [input4, setInput4] = useState('');
  const [datetime, setDatetime] = useState('');
  const [input6, setInput6] = useState('');
  const [input7, setInput7] = useState('');
  const [input8, setInput8] = useState('');

  // useEffect(() => {
  //   const storedData = localStorage.getItem('logData');
  //   if (storedData) {
  //     setLogData(JSON.parse(storedData));
  //   }
  // }, []);

  useEffect(() => {
    localStorage.setItem('logData', JSON.stringify(logData));
  }, [logData]);

  const handleInput1Change = (event) => {
    setInput1(event.target.value);
  };

  const handleInput2Change = (event) => {
    setInput2(event.target.value);
  };

  const handleInput3Change = (event) => {
    setInput3(event.target.value);
  };
  const handleInput4Change = (event) => {
    setInput4(event.target.value);
  };

  const handleDatetimeChange = (event) => {
    setDatetime(event.target.value);
  };

  const handleInput6Change = (event) => {
    setInput6(event.target.value);
  };

  const handleInput7Change = (event) => {
    setInput7(event.target.value);
  };
  const handleInput8Change = (event) => {
    setInput8(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    setLogData([...logData, { input1, input2, input3, input4, datetime, input6, input7, input8  }]);
    setInput1('');
    setInput2('');
    setInput3('');
    setInput4('');
    setDatetime('');
    setInput6('');
    setInput7('');
    setInput8('');


  };

  const handleDeleteAll = () => {
    setLogData([]);
    localStorage.removeItem('logData');
  };

  return (
    <table className="log-table">
      <thead>
        <tr>
          <th>Date / morning</th>
          <th>Yes / No</th>
          <th>level</th>
          <th>Log</th>
          <th>Evening</th>
          <th>Yes / No</th>
          <th>level</th>
          <th>Log</th>
        </tr>
      </thead>
      <tbody>
        {logData.map((item, index) => (
          <tr key={index}>
            <td>{item.input1}</td>
            <td>{item.input2}</td>
            <td>{item.input3}</td>
            <td>{item.input4}</td>
            <td>{item.datetime}</td>
            <td>{item.input6}</td>
            <td>{item.input7}</td>
            <td>{item.input8}</td>
          </tr>
        ))}
      </tbody>
      <tfoot>
        <tr>
          <td>
            <input
              type="date"
              value={input1}
              onChange={handleInput1Change}
              placeholder="Input 1"
            />
          </td>
          <td>
            <input
              type="text"
              value={input2}
              onChange={handleInput2Change}
              placeholder="Input 2"
            />
          </td>
          <td>
            <input
              type="number"
              value={input3}
              onChange={handleInput3Change}
              placeholder="Input 3"
            />
          </td>
          <td>
            <input
              type="text"
              value={input4}
              onChange={handleInput4Change}
              placeholder="Input 4"
            />
          </td>
          <td>
            <input
              type="datetime-local"
              value={datetime}
              onChange={handleDatetimeChange}
            />
          </td>
          <td>
            <input
              type="text"
              value={input6}
              onChange={handleInput6Change}
              placeholder="Input 6"
            />
          </td>
          <td>
            <input
              type="number"
              value={input7}
              onChange={handleInput7Change}
              placeholder="Input 7"
            />
          </td>
          <td>
            <input
              type="text"
              value={input8}
              onChange={handleInput8Change}
              placeholder="Input 8"
            />
          </td>
          <td className="delete-all">
            <button onClick={handleSubmit}>Add</button>
          </td>
          <td>
            <button onClick={handleDeleteAll}>Delete All</button>
          </td>
        </tr>
      </tfoot>
    </table>
  );

}

export default LogTable;
